    false,nt"url": null,nt"notes": "NODC Accession 0135461 includes physical
    and underway data collected aboard the ROBERT GORDON SPROUL during cruise SP1312
    in the North Pacific Ocean from 2013-10-23 to 2013-10-25. These data include CURRENT
    SPEED - EAST/WEST COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH COMPONENT (V). The
    instruments used to collect these data include ADCP and GPS. These data were collected
    by Matthias Lankhorst of University of California - San Diego; Scripps Institution
    of Oceanography as part of Consortium on Ocean Role in Climate (CORC): Recovery
    Cruise. The Lamont-Doherty Earth Observatory (LDEO) submitted these data to NODC
    as part of the NSF sponsored Rolling Deck to Repository (R2R) program.nnThe ADCP
    data represent the raw and automated processed data set. Post processed quality
